import { yellow } from "@material-ui/core/colors";
import { sizeHeight } from "@material-ui/system";

export const styles = () => ({
  "@global": {
    body: {
      margin: 0
    },
    "#__next": {
      // background: "yellow"
    }
  },
  root: {
    // background: "blue"
  },
  container: {
    // background: "green",
    display: "flex",
    maxWidth: 1280,
    margin: "auto"
  },
  upperNav: {
    borderBottom: `solid 1px #2f3033`,
    "& > $container": {
      height: 44
    }
  },
  lowerNav: {
    borderBottom: `solid 1px #2f3033`,
    "& > $container": {
      height: 66,
      display: "flex"
    }
  },
  emptySpacing: {
    flexGrow: 1
  },
  navActionGroup: {
    display: "flex",
    "& > p": {
      width: 100,
      display: "flex",
      justifyContent: "center",
      alignItems: "center",
      fontSize: 16,
      "&:nth-child(2)": {
        fontWeight: 600
      }
    }
  },
  logo: {
    display: "flex",
    justifyContent: "center",
    alignItems: "center"
  },
  categories: {
    display: "flex",
    alignItems: "center",
    "& > div": {
      width: 100,
      display: "flex",
      justifyContent: "center",
      alignItems: "center"
    }
  }
});
